import React, { useState } from "react";
import Flight from "./Flight";

const Admindash = ({ flights }) => {
  const [showData, setShowData] = useState(false);

  const handleShowData = () => {
    setShowData(!showData);
  };

  return (
    <div>
      <button onClick={handleShowData}>

        {showData ? "Hide Data" : "Show Data"}

      </button>
      {showData && (
        <div>
          {flights.map((flight, index) => (
            <Flight
              key={index}
              airline={flight.airline}
              departureTime={flight.departureTime}
              departureGateNumber={flight.departureGateNumber}
              boardingLocation={flight.boardingLocation}
              price={flight.price}
              isBooked={flight.isBooked}
              bookedDate={flight.bookedDate}
              isCancelled={flight.isCancelled}
              cancelledDate={flight.cancelledDate}
              isRescheduled={flight.isRescheduled}
              rescheduledDate={flight.rescheduledDate}
            />
          ))}
        </div>
      )}
    </div>
  );
};

export default Admindash;
